import axios from 'axios'
 class PostsList extends Component {

    constructor(props) {
      super(props)
    
      this.state = {
         posts:[],
         error:"",
      }
    }
    componentDidMount(){
        axios.get('https://jsonplaceholder.typicode.com/posts') // double 
        .then(response=> {
            console.log(response)
            this.state({posts: response.data})
        })
        .catch( error => {
            console.log(error)
            
        })
        
    }

  render() {
    return (
      <div>PostsList
        {
            posts.length ?
            posts.map(post => <div key= {post.id}>{post.title}</div>):
            null
        }   
            

      </div>
    )
  }
}

export default PostsList
